import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';
import "./Components/Data"


class App extends Component {
  constructor(props){
    super(props)
  }

  render(){

    return (
      <div className="App">
        <header className="App-header">
          <h1>{this.props.data}</h1>
          test
          {this.props.dummy}
        </header>
      </div>
    );
  }
}

export default App;
